import { useEffect } from 'react'
import './App.css'
import { Currency } from './components/core/Currency'
import { useAppDispatch, useAppSelector } from './hooks/hooks'
import { getAllCurrency } from './store/currency'

export const App = () => {
  const allMoney = useAppSelector(state => state.currency.currency)
  const threeCurrency = allMoney.filter(el => el.cc === 'CAD' || el.cc === 'AED' || el.cc === 'USD')
  console.log(threeCurrency)

  const dispatch = useAppDispatch()
  useEffect(() => {
    dispatch(getAllCurrency())
  }, [dispatch])

  return (
    <div className="wrapper">
      <div>
        {threeCurrency.map(el => (
          <Currency key={el.r030} {...el} />
        ))}
      </div>
    </div>
  )
}
